/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import Rhombus from "../images/rhombus.svg";
import GitHubButton from "react-github-btn";
import "../pages/home.scss";

const mobile = `@media (max-width: 500px)`;

const AboutFooter = styled.footer`
width: 100%;
flex-shrink: 0;
text-align: 0;

  ${mobile} {
    transform: rotate(-90deg);
  }
}
`;

const RhombusContainer = styled.div`
display: flex;
  flex-shrink: 0;
  text-align: 0;

  ${mobile} {
    left: 200px;
  }
}
`;

const FooterEmail = styled.div`
  display: flex;
  paddingTop: 20%;
  zIndex: 1000;

  ${mobile} {
    top: 170px;
    left: 10px;
    position: absolute;
    color: grey;
  }
}
`;

export const Footer = () => (
  <AboutFooter className="footer" style={{ flexShrink: 0, textAlign: "center" }}>
    <FooterEmail>
    <div style={{marginTop: "25px"}}>
      <GitHubButton
        href="https://github.com/jschriemer/jschriemer.github.io"
        data-color-scheme="no-preference: dark_dimmed; light: dark; dark: dark_dimmed;"
        data-size="large"
        aria-label="Star jschriemer/jschriemer.github.io on GitHub"
      >
        Star
      </GitHubButton>
      </div>
      <RhombusContainer>
        <img
          src={Rhombus}
          style={{width: "20px"}}
        />
        <img
          src={Rhombus}
          style={{width: "20px"}}
        />
        <img
          src={Rhombus}
          style={{width: "20px"}}
        />
      </RhombusContainer>
      <p>jschriem@gmail.com</p>
    </FooterEmail>
  </AboutFooter>
);
